import React from "react";

function PersonForm(props) {
  return (
    <>
      {props.update && props.update.map((item) => item.name)}
      <form onSubmit={props.handleChange}>
        <div>
          <input
            type="text"
            value={props.value}
            onChange={props.onChange}
            id={props.id}
            name={props.name}
          />
        </div>
      </form>
    </>
  );
}

export default PersonForm;
